import React from "react";
import HeadTag from "./HeadTag";
import MediaCard from "./Card";
import Button from '@mui/material/Button';
import ArrowBackIcon from '@mui/icons-material/ArrowBack';
import Scripts from "./bottomContainer";

function RenderProjects(props) {

  const fullDiv = {
    "margin": "10%",
  };

  const anchorStyle = {
    "textDecoration": "none"
  };

  const data = props.items;

  return (

    <div>
      <HeadTag Title="Python" />
      <div className="container-fluid">

        <div style={fullDiv} className="row">

          {data.map((answer, i) => {
            console.log(answer);
            return (<div className="col-lg-4 col-md-6 col-sm-6 themes-img">
              <MediaCard
                key={i}
                Title={data[0].title}
                Image={data[0].img_url}
                Desc={data[0].desc}
                git_url={data[0].git_url}
              />
            </div>
            )

          })}

          <Button> <a style={anchorStyle} href="/themes"> <ArrowBackIcon /> All Themes </a> </Button>

        </div>
      </div>
      <Scripts></Scripts>
    </div>
  );


}

export default RenderProjects;
